import MainContent from './componenst/MainContent';
import data from './componenst/data';
import './App.css';


function App() {




  const sisu = data.map((item, index) => (
    <MainContent
      key={index}
      name={item.name}
      text={item.text}
      date={item.date}
      img={item.img}
      data={data}
    />
  ));
  const lisa = () => {
    return (
      <div>
        {data.map((item, index) => (
          <div key={index}>
            <p>{item.name}</p>
            <p>{item.date}</p>
          </div>
        ))}
      </div>
    );
  };

  return (
    <div className="App">
      {sisu}
      <button onClick={lisa}>Lisa andmed</button>
      {lisa()}
    </div>
  );
}

export default App;
